export const searchLocation = async (query: string): Promise<GeocodingResult[]> => {
  const normalizedQuery = query.toLowerCase().trim();
  return dehradunLocations.filter(
    location => 
      location.placeName.toLowerCase().includes(normalizedQuery) ||
      location.area.toLowerCase().includes(normalizedQuery)
  );
};

export const getCurrentLocation = (): Promise<GeolocationPosition> => {
  return new Promise((resolve, reject) => {
    if (!navigator.geolocation) {
      reject(new Error('Geolocation is not supported by your browser'));
      return;
    }

    navigator.geolocation.getCurrentPosition(resolve, reject, {
      enableHighAccuracy: true,
      timeout: 5000,
      maximumAge: 0
    });
  });
};

export const findNearestLocation = (latitude: number, longitude: number): GeocodingResult => {
  let nearestLocation = dehradunLocations[0];
  let shortestDistance = calculateDistance(
    latitude,
    longitude,
    dehradunLocations[0].latitude,
    dehradunLocations[0].longitude
  );

  for (const location of dehradunLocations) {
    const distance = calculateDistance(
      latitude,
      longitude,
      location.latitude,
      location.longitude
    );
    if (distance < shortestDistance) {
      shortestDistance = distance;
      nearestLocation = location;
    }
  }

  return nearestLocation;
};

const calculateDistance = (lat1: number, lon1: number, lat2: number, lon2: number): number => {
  const R = 6371; // Earth's radius in kilometers
  const dLat = toRad(lat2 - lat1);
  const dLon = toRad(lon2 - lon1);
  const a =
    Math.sin(dLat / 2) * Math.sin(dLat / 2) +
    Math.cos(toRad(lat1)) * Math.cos(toRad(lat2)) *
    Math.sin(dLon / 2) * Math.sin(dLon / 2);
  const c = 2 * Math.atan2(Math.sqrt(a), Math.sqrt(1 - a));
  return R * c;
};

const toRad = (value: number): number => (value * Math.PI) / 180;